    marginRight           : '-50%',
    transform             : 'translate(-50%, -50%)',
    backgroundColor: "rgb(42,95,158)"
  }
};*/

function Login() {
  const [usernameInput,setUsernameInput] = useState("");
  /*const history = useHistory();
  const [modalIsOpen,setIsOpen] = useState(false);
  const [buttonString,setButtonString] = useState("");
  
  <Modal
          isOpen={modalIsOpen}
          style={customStyles}
          contentLabel="Example Modal"
        >
        </Modal>
  */

  /* function JumpRedirect(page){
       
    setButtonString(page)
    setIsOpen(true);
}*/
  /* function Redirect(page){

    history.push("/"+page);
    return <Redirect    to={{
      pathname:'/'+page
        }}/>
  }*/

  function Log() {
    if (localStorage.getItem("user")) {
      //Connected
      localStorage.removeItem("user");
    } else {
      localStorage.setItem("user", "tsach");
    }
    loginConfirmed.subjectTrigger();
  }

  return (
    <div className="Home">
      <div className="login">
        <p staly={{ marginBottom: "30px" }}>PartnerTAU ברוכים הבאים לאתר</p>
        <div>
          <input on type="text"></input>שם משתמש
        </div>
        <div>
          <input type="text" style={{ marginBottom: "30px" }}></input>סיסמה
        </div>
        <div className="Row">
          <button className="button button1">שכחתי סיסמה</button>
          <button className="button button1">הירשם</button>
          <button onClick={Log} className="button button1">
            התחבר
          </button>
        </div>
      </div>
      <button className="button button1">התחבר באמצעות גוגל</button>
    </div>
  );
}

export default Login;
